agram below, not drawn to scale, ABCD is a rectangle and BCE is an equilateral triangle. Find &ang;BAE.','ms','2023-06-05 00:00:00','G','RGS 2010 SA2.1','5.2.2.1','M'),(214,'MA_P6','The cube in Figure 1 was cut into three identical blocks. The three blocks were used to form the cuboid in Figure 2. <br>Find the ratio of AB to BC to CD.','ms','2023-06-05 00:00:00','G','RGS 2010 SA2.1','6.2.1.2','M'),(215,'MA_P6','Jill bought 12 oranges and received 4 apples. She packed them into bags of 2 oranges and 1 apple. Each bag of fruits was sold at $1.20 each and the remaining oranges were sold at $0.50 each. How much did she receive from the sales of all the fruits ?','ms','2023-06-05 00:00:00','','RGS 2010 SA2.1','6.1.3.1','M'),(216,'MA_P6','The figure shown is made up of a rectangle and 2 identical squares. The area of the shaded rectangle is thrice the area of a square. The breadth of the rectangle is 3 cm. What is the perimeter of the whole figure ?','ms','2023-06-05 00:00:00','G','RGS 2010 SA2.1','5.2.1.1','M'),(217,'MA_P6','Simplify ( 15p + 15p ) Ã· 5 + 5p x 5 + 5 . ','ms','2023-06-05 00:00:00','','RGS 2010 SA2.1','6.1.5.1','A'),(218,'MA_P6','The diagram below forms the net of a cube when one of the squares is removed. <br>Mark the square that should be remove from with a â€œXâ€','ms','2023-06-05 00:00:00','G','RGS 2010 SA2.1','6.2.1.2','A'),(219,'MA_P6','There are three containers, X, Y and Z.<br>One contains blue marbles, another white marbles and the third one, a mixture of blue and white marbles and all of them are labelled wrongly. You are allowed to select one container and take out only one marble from it without looking into it.<br>Which container would you select in order to state correctly where all the labels ought to go ?','ms','2023-06-05 00:00:00','G','RGS 2010 SA2.1','6.4.1.1','A'),(220,'MA_P6','Which of the following is nine hundred and eighteen thousand and twelve in figures ?','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','5.1.1.1','E'),(221,'MA_P6','50 000 Ã· 200 = _____________ x 5','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','5.1.1.1','E'),(222,'MA_P6','Find the value of 28 + ( 19 â€“ 17 ) x 3 â€“ 12 + 9','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','5.1.1.2','E'),(223,'MA_P6','7 hundreds, 8 tenths and 2 thousandth is ____________________','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','5.1.3.1','E'),(224,'MA_P6','The mass of 4 identical lollipops is 45.08 g. Find the mass of 2 such lollipops.','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','5.1.3.1','M'),(225,'MA_P6','Find the volume of the cuboid shown below.','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','6.2.1.2','M'),(226,'MA_P6','Derrick constructed a set of shelves as shown below. Which pair of shelves are parallel to the ground ?','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','5.2.2.3','M'),(227,'MA_P6','Identify the two squares that can be crossed out from the following figure so that the remaining figure will become the net of a cube.','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','6.2.1.2','M'),(228,'MA_P6','Shah and Lionel have a sum of money. If Shah spends <math><mfrac><msup>3</msup><msup>5</msup></mfrac></math> of his money and Lionel spends <math><mfrac><msup>3</msup><msup>7</msup></mfrac></math> of his, the two boys will have the same amount of money left. What fraction of the total sum of money is Lionelâ€™s money ? ','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','6.1.1.1','M'),(229,'MA_P6','Marieâ€™s score for Mathematics has improved from 50 marks to 75 marks. What is the percentage increase ?','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','5.1.4.1','M'),(230,'MA_P6','What is the total length of 5 erasers identical to the one shown in the figure below ?','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','5.2.2.3','M'),(231,'MA_P6','The figure below is made up of 6 cubes of 3 different sizes. What is the ratio of the total volume of the small cubes to the total volume of the medium cubes to the volume of the large cubes ?','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','6.2.1.2','M'),(232,'MA_P6','Which of the following unit shapes <strong>cannot</strong> be tesellated ?','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','5.2.2.3','A'),(233,'MA_P6','The line graph shows the number of Incoming calls and Outgoing calls made by Jiemin through her mobile phone over a week. <br>On which day was there the greatest difference between the number of Incoming calls and Outgoing calls?','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','5.3.1.1','A'),(234,'MA_P6','Express the perimeter of the following figure in terms of <em>x</em>.','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','6.1.5.1','A'),(235,'MA_P6','Mr Zhang bought 5908 magnets. He packed all the magnets into boxes of 7. How many boxes were there ?','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','5.1.1.2','E'),(236,'MA_P6','What is the missing number in the box ? Express your answer as a mixed number in its simplest form.<br>1<math><mfrac><msup>3</msup><msup>5</msup></mfrac></math> + 2<math><mfrac><msup>1</msup><msup>10</msup></mfrac></math> â€“ <svg width=\"30\" height=\"30\"> <rect width=\"30\" height=\"30\" <rect width=\"40\" height=\"40\" style=\"fill:rgb(255,255,255);stroke-width:3;stroke:rgb(0,0,0)\"/> /></svg> = <math><mfrac><msup>1</msup><msup>2</msup></mfrac></math>','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','6.1.1.1','E'),(237,'MA_P6','Find the product of 2<math><mfrac><msup>7</msup><msup>9</msup></mfrac></math> and 33. (Give your answer in its simplest form.)','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','6.1.1.1','E'),(238,'MA_P6','AB, CD, EF and FG are straight lines. Find &ang;<em>p</em> .','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','5.2.2.1','E'),(239,'MA_P6','The figure below shows two lines, PQ and QR, on a square grid. Draw and label anothe  line PS such that PS // QR and PS = QR.','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','5.2.2.3','M'),(240,'MA_P6','The cost of 3 mangoes is the same as the cost of 5 grapefruits. The cost of 3 mangoes is also the same as the cost of 10 pears. Find the ratio of the cost of a mango to the cost of the grapefruit to the cost of a pear.','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','6.1.3.1','M'),(241,'MA_P6','Jean cycled at a speed of 20 km/h for 15 minutes from her home to her office. What is the distance between Jeanâ€™s home and office ?','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','6.1.4.1','M'),(242,'MA_P6','The mass of an apple and an orange when corrected to the nearest gram are 40 g and 63 g respectively. Calculate the least possible mass of an apple and 2 such oranges. ','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','5.1.1.1','M'),(243,'MA_P6','Mr Tan started work on sculpture at 1.45 a.m. and completed it at 9.30 p.m. on the same day. How much time did he take to complete the sculpture ?','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','5.1.6.1','M'),(244,'MA_P6','The figures E, S and C given below are made from squares of equal size. Arrange them in an ascending order in accordance to their perimeters.','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','5.2.2.3','M'),(245,'MA_P6','Tap A takes 6 minutes to fill Tank C. Tap B takes 4 minutes to fill Tank C. If Tap A and B turned on at the same time, how long would they take to fill <math><mfrac><msup>3</msup><msup>4</msup></mfrac></math> of Tank C ?','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','6.1.4.1','M'),(246,'MA_P6','Ali scores a total of 168 marks for his Mathematics test and English test. He scored <em>x</em> more marks for his English test than his Mathematics test. <br>(a) How many marks did he score for his English test ? (Give your answer in terms of <em>x</em>) <br>(b) How many marks did he score for his English test if <em>x</em> = 8 ?','ms','2023-06-07 00:00:00','','NANYANG 2010 SA2.1','6.1.5.1','M'),(247,'MA_P6','The pie chart below shows the result of a survey on the favourite brands of potato chips of 50 children. A bar graph is also drawn to show the same information but it is incomplete. <br>Complete the bar chart with the data given in the pie chart.','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','6.3.1.1','A'),(248,'MA_P6','View 1 and 2 are two nets of the same cube. Using the information given in View 1, put a cross (<strong>X</strong>) on the face that is opposite the letter <strong>A</strong> on the cube in View 2.','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','6.2.2.1','A'),(249,'MA_P6','The figure below is formed by stacking 4  pieces of square paper one on top of another. The papers have different prints and sizes (of sides 3 cm, 4 cm, 5 cm and 6 cm). The 6-cm piece is placed at the bottom of the stack, followed by the 5-cm piece, then the 4-cm piece adn the 3-cm piece right on the top. Find the sum of the area A and B.','ms','2023-06-07 00:00:00','G','NANYANG 2010 SA2.1','5.2.2.3','A'),(250,'MA_P6','Find the value of 6<em>w</em> + (5 + 3<em>w</em>) + <em>w</em> when <em>w</em> = 50.','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.1.5.1','E'),(251,'MA_P6','There are some boys and girls in the indoor sports hall. <math><mfrac><msup>1</msup><msup>2</msup></mfrac></math> of the number of boys in the indoor sports hall is the same as 60% of the number of girls. If there are 25 more boys than girls in the indoor sports hall, how many children are there altogether ?','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','5.1.4.1','E'),(252,'MA_P6','A side of right-angled isosceles triangle is drawn below. Using the square grid provided, draw and label the right-angled isosceles triangle ABC where is &ang;ACB is 90Âº.','ms','2023-06-08 00:00:00','G','RGS 2010 SA2.3','5.2.2.2','E'),(253,'MA_P6','BCD and ACE are equilateral triangles. CD is <math><mfrac><msup>1</msup><msup>4</msup></mfrac></math> the length of CE. The two shaded triangles are identical. <br>What fraction of ACE is shaded ?','ms','2023-06-08 00:00:00','G','RGS 2010 SA2.3','5.2.2.2','E'),(254,'MA_P6','City A and City B was 300 km apart. Jason and Kevin were driving from City A to City B. In the journey, Jason passed a petrol kisok 1 hour before Kevin while Kevin was 60 km away from the petrol kisok. <br>How long did Kevin take to travel from City A to City B ?','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.1.4.1','E'),(255,'MA_P6','The pie chart shows the number of coloured buttons in a box. The number of red buttons is the same as the number of yellow buttons.<br>How many blue buttons are there in the box ? ','ms','2023-06-08 00:00:00','G','RGS 2010 SA2.3','6.3.1.1','M'),(256,'MA_P6','Grandpa had a farm. He kept 89 goats and chickens. The total number of legs the animal had was 264 legs.<br>How many chickens did Grandpa have ?','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.1.1.1','M'),(257,'MA_P6','A pen cost $y. A book costs 40Â¢ more than a pen. A ruler costs 20Â¢ less than a book. How much would i need to buy 3 pens and one ruler ?','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.1.3.1','M'),(258,'MA_P6','The figure below is not drawn to scale. ABCD is parallelogram. EFG and HIJ are triangles. &ang;IHJ = 81Âº.<br>(a) Find &ang;GJH.<br>(b) Find the sum of &ang;EFG, &ang;EGF, &ang;ELJ, &ang;EKH','ms','2023-06-08 00:00:00','G','RGS 2010 SA2.3','6.2.2.1','M'),(259,'MA_P6','Henry made <math><mfrac><msup>15</msup><msup>16</msup></mfrac></math><em>l</em> of lemonade. In the morning, he sold <math><mfrac><msup>2</msup><msup>5</msup></mfrac></math> of the lemonade. In the afternoon, Henry sold <math><mfrac><msup>1</msup><msup>5</msup></mfrac></math><em>l</em> of the lemonade. How many litres of lemonade had Henry left at the end ?','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.1.1.1','M'),(260,'MA_P6','A tank with a square base of side 60 cm, 80 cm tall, was <math><mfrac><msup>1</msup><msup>3</msup></mfrac></math> filled with water.<br>(a) Find the volume of water in the tank.<br>(b) At 1 p.m., a tap was turned on to drain water out at a rate of 10 <em>l</em> per minute. 6 minutes later, another tap was turned on to fill the tank at 12 <em>l</em> per minute. Find the volume of water in the tank at 1.10 p.m.','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.2.1.2','M'),(261,'MA_P6','There were 4 children, Alex, Betty, Cathy and David.<br>Each child was given $250 and the average expenditure of the 4 children was $67. The amount spent by each child is shown in the table below.<br><table style=\"width:100%\"><tr><th>Name</th><th>Amount Spend</th></tr><tr><td>Alex</td><td>$69</td></tr><tr><td>Betty</td><td>$37</td></tr><tr><td>Cathy</td><td>$111</td></tr><tr><td>David</td><td>?</td></tr></table> <br>(a) How much did David spend ? <br>(b) How much did the 4 children have left altogether ?','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','5.3.1.1','M'),(262,'MA_P6','The table below shows the prices for printing a photograph in a printing shop.<br><table style=\"width:100%\"><tr><th>Number of photographs</th><th>Price</th></tr><tr><td>First 10 pieces</td><td>$2.50 per piece</td></tr><tr><td>Every additional piece</td><td>$1.50 per piece</td></tr></table><br>(a) Lisa printed 30 photographs. How much did she pay ? <br>(b) John paid $43 to print his photographs. How many photographs did he print ?','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.1.3.1','A'),(263,'MA_P6','Janice had three boxes, A, B and C, containing a total of 1512 pearls. The number of pearls in Box A to the total number of pearls was 2 : 7. Janice sold 190 pearls from Box B and sold <math><mfrac><msup>1</msup><msup>4</msup></mfrac></math> of the pearls in Box C. The number of pearls left in Box B to the number left in Box C was 2 : 1.<br>How many pearls were there in Box C at first ?','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.1.3.1','A'),(264,'MA_P6','The figure below shows tow identical semicircles. <em>XY</em> is a straight line. <em>X</em> and <em>Y</em> are the centres of the semicircles. Given that radius of the semicircle is 10 cm, find<br>(a) the area of the shaded regions.<br>(b) the perimeter of the figure.<br>Give your answers correct to 2 decimal places. ','ms','2023-06-08 00:00:00','G','RGS 2010 SA2.3','6.2.1.1','A'),(265,'MA_P6','Irene had a total of 1686 red, blue and green balloons for a sale. The ratio of the number of red balloons to the number of blue balloons was 2 : 3. After Irene sold <math><mfrac><msup>3</msup><msup>4</msup></mfrac></math> of the blue balloons, <math><mfrac><msup>1</msup><msup>2</msup></mfrac></math> of the green balloons and none of the red balloons, she had 922 balloons left.<br>How many blue balloons did Irene have at first ?','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.1.3.1','A'),(266,'MA_P6','Crystal left Town A at 1 p.m. travelling at 64 km/h towards Town B. Half an hour later, Wendy left Town A, travelling at 80 km/h towards Town B.<br>(a) How far ahead was Crystal when Wendy left Town A ?<br>(b) At what time would Wendy be 8 km ahead Crystal ?','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.1.4.1','A'),(267,'MA_P6','There are more pupils in School A than School B. 30% of the pupils in School A is 45 more than 40% of the pupils in School B. If 10% of the pupils in School A leaves to join School B, there will be 200 more pupils in School A than School B.<br>(a) How many pupils are there in School B ?<br>(b) How many percent less pupils are there in School B than School A ?<br>Leave your answer as fraction in the simplest form.','ms','2023-06-08 00:00:00','','RGS 2010 SA2.3','6.1.3.1','A');
